import React from 'react';

import LineWithDots from '../Line/Line';
import LogoRound from '../LogoRound/LogoRound';
import ContactForm from '../ContactForm/ContactForm';
import LinksBlock from '../LinksBlock/LinksBlock';
import AddressBlock from '../AddressBlock/AddressBlock';
import SoMeIcons from '../SoMe/SoMe';

const Footer = () => {
  return(
    <div className="FooterWrapper FooterWrapper--twoRows FooterWrapper--oneRow">

      <div className="FooterWrapper__item">
        <LogoRound />
      </div>
      <div className="FooterWrapper__item">
        <ContactForm />
      </div>
      <div className="FooterWrapper__item">
        <LinksBlock data={links} />
      </div>
      <div className="FooterWrapper__item">
        <LinksBlock data={aboutUs} />
      </div>
      <div className="FooterWrapper__item">
        <AddressBlock />
      </div>
      <div className="FooterWrapper__item">
        <SoMe />
      </div>
      <div className="FooterWrapper__item"><LineWithDots /></div>
    </div>
  )
}

export default Footer;


/* 

  Data for the links blocks

*/

/* Block One: Links  */
const links = {
  heading: 'Links',
  links: [
    {
      desc: 'faq',
      href: '#'
    },
    {
      desc: 'blog',
      href: '#'
    },
    {
      desc: 'find salon',
      href: '#'
    },
    {
      desc: 'opret salon',
      href: '#'
    },
  ]
};

/* Block Two: About us */
const aboutUs = {
  heading: 'Om os',
  links: [
    {
      desc: 'team',
      href: '#'
    },
    {
      desc: 'kontakt',
      href: '#'
    },
  ]
};
